('1', '2', '5', '', '2020-05-11 00:30:37', '966', '588', 'ce108edf7969f6e017a5bcc9cc83d7a40905fdf7', '{\"id\":2,\"asset_id\":\"27\",\"parent_id\":\"1\",\"lft\":\"1\",\"rgt\":\"2\",\"level\":\"1\",\"path\":\"uncategorised\",\"extension\":\"com_content\",\"title\":\"Wavex\",\"alias\":\"uncategorised\",\"note\":\"\",\"description\":\"\",\"published\":\"1\",\"checked_out\":\"966\",\"checked_out_time\":\"2020-05-11 00:30:32\",\"access\":\"1\",\"params\":\"{\\\"category_layout\\\":\\\"\\\",\\\"image\\\":\\\"\\\",\\\"image_alt\\\":\\\"\\\"}\",\"metadesc\":\"\",\"metakey\":\"\",\"metadata\":\"{\\\"author\\\":\\\"\\\",\\\"robots\\\":\\\"\\\"}\",\"created_user_id\":\"966\",\"created_time\":\"2020-05-06 23:18:02\",\"modified_user_id\":\"966\",\"modified_time\":\"2020-05-11 00:30:37\",\"hits\":\"0\",\"language\":\"*\",\"version\":\"1\"}', '0'),
('2', '1', '1', '', '2020-05-11 00:34:03', '966', '3465', '840b2b947b8eb9e41756f66cbc7f02bec249b6f8', '{\"id\":1,\"asset_id\":88,\"title\":\"Discount Codes for kitesurf, surf and travel brands\",\"alias\":\"discount-codes-for-kitesurf-surf-and-travel-brands\",\"introtext\":\"<p>The big point for us was the campervan, as it meant total independence.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>The big point for us was the campervan, as it meant total independence. Having our bed, toilet, kitchen, kite stuff and everything else with us all the time, meant that we didn\\u2019t have to plan the days in advance. Also, breastfeeding makes traveling with baby super easy, as you don\\u2019t have to prepare milk bottles or disinfect bottles every 2-3 hours.<\\/p>\\r\\n<p>If you choose to travel to a destination where you rent a room or apartment, I would strongly suggest having accommodation right at the kite spot. And of course, you should inform yourself about the local health situation (health hazards and health care) a lot more in detail than when you just travel on your own.<\\/p>\\r\\n<blockquote>\\r\\n<p>Sem justo facilisi, pulvinar feugiat sed cursus donec vestibulum, rutrum mauris montes felis, quam metus sed in. In curabitur, ut in auctor ut, egestas nunc elit lectus sed sed.<\\/p>\\r\\n<footer>January 23, 2019Happy Customer<\\/footer><\\/blockquote>\\r\\n<p>Saltbeat is one of the very few brands on the market that combines fashion with functionality in such a beautiful way. They are creating luxurious pieces that can withstand the most radical of waterwomen and combine chic with \\u201cstaying put\\u201d even in the wipe out and during kite crashes.<\\/p>\",\"state\":1,\"catid\":\"2\",\"created\":\"2020-05-11 00:34:03\",\"created_by\":\"966\",\"created_by_alias\":\"\",\"modified\":\"2020-05-11 00:34:03\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2020-05-11 00:34:03\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/gallery\\\\\\/29.jpg\\\",\\\"float_intro\\\":\\\"none\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/gallery\\\\\\/04.jpg\\\",\\\"float_fulltext\\\":\\\"none\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\",\\\"helix_ultimate_image\\\":\\\"\\\",\\\"helix_ultimate_image_alt_txt\\\":\\\"\\\",\\\"helix_ultimate_article_format\\\":\\\"standard\\\",\\\"helix_ultimate_audio\\\":\\\"\\\",\\\"helix_ultimate_gallery\\\":\\\"\\\",\\\"helix_ultimate_video\\\":\\\"\\\"}\",\"version\":1,\"ordering\":null,\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":null,\"metadata\":\"{\\\"robots\\