('79', '11', '1', '', '2020-06-03 23:37:10', '966', '4331', 'd332fa3e9accf93b7650ea5e9bfb17050ffe4b07', '{\"id\":11,\"asset_id\":\"140\",\"title\":\"Our Company Offers A Wide Range Of Services To Meet your needs.\",\"alias\":\"discount-codes-for-kitesurf-surf-and-travel-brands\",\"introtext\":\"<p>We are dedicated to providing awesome customer service &amp; reflecting core values of integrity, promptness, and the highest standards of tree work in the Industry.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Duncan Tree is a San Diego, California based tree service company providing expert, quality work. You can depend on our trained employees to provide courteous and knowledgeable service. We take pride in our work, just as you take pride in your home.<\\/p>\\r\\n<p>From tree trimming to removal, you can count on us to get the job done right. Our crews are professional, thorough, and reliable. The new beauty of your trees will impress all who pass by, year after year.<\\/p>\\r\\n<p>We are a proactive organization that maintains the highest standards of tree care; and which always considers safety, tree health, and curb appeal. We are dedicated to providing awesome customer service &amp; reflecting core values of integrity, promptness, and the highest standards of tree work in the Industry.<\\/p>\\r\\n<p>With a passion for trees and their valuable contribution to our ecosystem, our goal is to enhance curb appeal\\/ aesthetic look of trees, identify any: hazardous, declining, or diseased trees, and determining if a tree may be causing any structural damage.<\\/p>\\r\\n<blockquote>\\r\\n<p>Sem justo facilisi, pulvinar feugiat sed cursus donec vestibulum, rutrum mauris montes felis, quam metus sed in. In curabitur, ut in auctor ut, egestas nunc elit lectus sed sed.<\\/p>\\r\\n<footer><span class=\\\"blog-text\\\">January 23, 2019<\\/span> <span class=\\\"blog-text\\\">Happy Customer<\\/span><\\/footer><\\/blockquote>\\r\\n<p>We are a proactive organization that maintains the highest standards of tree care; and which always considers safety, tree health, and curb appeal. We are dedicated to providing awesome customer service &amp; reflecting core values of integrity, promptness, and the highest standards of tree work in the Industry.<\\/p>\\r\\n<p>With a passion for trees and their valuable contribution to our ecosystem, our goal is to enhance curb appeal\\/ aesthetic look of trees, identify any: hazardous, declining, or diseased trees, and determining if a tree may be causing any structural damage.<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":1,\"catid\":\"18\",\"created\":\"2020-05-11 00:34:03\",\"created_by\":\"966\",\"created_by_alias\":\"\",\"modified\":\"2020-06-03 23:37:10\",\"modified_by\":\"966\",\"checked_out\":\"966\",\"checked_out_time\":\"2020-06-03 23:33:37\",\"publish_up\":\"2020-05-11 00:34:03\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/post\\\\\\/05.jpg\\\",\\\"float_intro\\\":\\\"none\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/post\\\\\\/05.jpg\\\",\\\"float_fulltext\\\":\\\"none\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"