('152', '26', '1', '', '2021-01-06 01:48:50', '966', '3973', 'ab4152e3e46d1d5d29873248d5a537496a8ba40a', '{\"id\":26,\"asset_id\":\"221\",\"title\":\"Commands vs: What are they and why does it matter?\",\"alias\":\"commands-vs-what-are-they-and-why-does-it-matter\",\"introtext\":\"<p>Since the standard of play has significantly been raised in woman\\u2019s chest over the last few<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Since the standard of play has significantly been raised in woman\\u2019s chest over the last few decades, there are now several women competing against the top players in the world. Therefore making any list of the top female chess players of all time is quite a tricky job.<\\/p>\\r\\n<p>Chess boxing is precisely what it claims \\u2014 an integration of the intellectual components of chess with the physical challenges of boxing. This sport uses the two endurance extremes and craftily blends them together to figure out which participant will prevail in a combat of the mind and the body. Credit for the initial development of the sport is given to Iepe Rubingh, who is a performance artist and painter.<\\/p>\\r\\n<p>Though, unofficial reports have also stated that the sport was invented back in 1979 by brothers Stewart and James Robinson. Both of these brothers were avid players of chess and they were classed as amateur boxers as well. However, Rubingh has been credited by a number of individuals for the modern version of the sport, which was inspired by Froid Equateur, the 1992 comic that was penned by artist Enki Bilal. The first chess boxing competition took place in 2003 in Berlin.<\\/p>\\r\\n<blockquote>\\r\\n<p><em class=\\\"big\\\"> Sem justo facilisi, pulvinar feugiat sed cursus donec vestibulum, rutrum mauris montes felis, quam metus sed in. In curabitur, ut in auctor ut, egestas nunc elit lectus sed sed. <\\/em><\\/p>\\r\\n<footer>\\r\\n<p>January 23, 2019<\\/p>\\r\\n<span class=\\\"divider\\\">|<\\/span>\\r\\n<p>Web hosting<\\/p>\\r\\n<\\/footer